import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Outlet, Navigate, useNavigate } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import Login from '../Routes/Login'; // Import your Login component
import Register from '../Routes/Register'; // Import your Register component
import PatientDashboard from '../Users/patient'; // Import your PatientDashboard component
import DoctorDashboard from '../Users/doctor'; // Import your DoctorDashboard component
import AdminDashboard from '../Users/admin'; // Import your AdminDashboard component

 
 function App() {
   const [isLogin, setIsLogin] = useState(true);
   const [user, setUser] = useState(null);
   const navigate = useNavigate();
 
   const handleLogin = (userData) => {
     setUser(userData);
     navigate('/dashboard');
   };
 
   const handleLogout = () => {
     setUser(null);
     navigate('/login');
   };
 
   const renderAuthButtons = () => {
     if (user) {
       return (
         <>
           <Navbar.Text>Signed in as: {user.name}</Navbar.Text>
           <Button variant="link" onClick={handleLogout}>Logout</Button>
         </>
       );
     } else {
       return (
         <>
           <Button variant="primary" onClick={() => setIsLogin(!isLogin)}>
             {isLogin ? 'Register' : 'Login'}
           </Button>
         </>
       );
     }
   };
 
   return (
     <Router>
       <div>
         <Navbar expand="lg" className="bg-body-tertiary">
           <Container>
             <Navbar.Brand as={Link} to="/">Your App</Navbar.Brand>
             <Navbar.Toggle aria-controls="basic-navbar-nav" />
             <Navbar.Collapse id="basic-navbar-nav">
               <Nav className="me-auto">
                 <Nav.Link as={Link} to="/home">Home</Nav.Link>
                 {/* Add other navigation links for different pages */}
               </Nav>
               <Navbar.Collapse className="justify-content-end">
                 {renderAuthButtons()}
               </Navbar.Collapse>
             </Navbar.Collapse>
           </Container>
         </Navbar>
 
         <Routes>
           <Route path="/login" element={<Login onLogin={handleLogin} />} />
           <Route path="/register" element={<Register onRegister={handleLogin} />} />
           <Route path="/dashboard/*" element={<Dashboard />} />
           <Route index element={<Navigate to="/login" />} />
         </Routes>
       </div>
     </Router>
   );
 }
 
 function Dashboard() {
   // Add logic to determine which dashboard to render based on user role.
   // Render the appropriate dashboard component or navigate the user to the login page if not logged in.
 }
 
 export default App;
